import React from 'react';

const Head = () => {
  return (
    <div className='grid grid-cols-3 gap-4 items-center p-4'>
      <div className='flex'>
        <img className='h-8' alt='menu' src='https://static.vecteezy.com/system/resources/thumbnails/002/292/406/small/hamburger-menu-line-icon-free-vector.jpg' />
        <img className='h-8' alt='youtube-logo' src='https://lh3.googleusercontent.com/3zkP2SYe7yYoKKe47bsNe44yTgb4Ukh__rBbwXwgkjNRe4PykGG409ozBxzxkrubV7zHKjfxq6y9ShogWtMBMPyB3jiNps91LoNH8A=s500' />
      </div>
      <div className='flex'>
        <input
          className='px-2 py-1 border rounded-md'
          type='text'
          placeholder='Search'
        />
        <button className='ml-2 px-4 py-1 bg-blue-500 text-white rounded-md'>Search</button>
      </div>
      <div>
        <img className='h-8' alt='user-icon' src='https://cdn-icons-png.flaticon.com/512/3177/3177440.png' />
      </div>
    </div>
  );
}

export default Head;
